'use client'
import i18n from 'i18next'
import { initReactI18next } from 'react-i18next'

import data from './languages.json'

export const languages = data.languages
interface Language {
  value: string;
  name: string;
  prompt_name: string;
  example: string;
  supported: boolean;
}

const loadLangResources = (lang: string) => ({
  translation: {
    common: require(`./${lang}/common`).default,
    layout: require(`./${lang}/layout`).default,
    dintal: require(`./${lang}/dintal`).default,
  },
})

// Automatically generate the resources object
const resources = languages.reduce((acc: any, value: string) => {
  // 获取项目名称
  acc[value] = loadLangResources(value)
  return acc
}, {})

i18n.use(initReactI18next)
  .init({
    lng: 'zh-Hans',
    fallbackLng: 'zh-Hans',
    resources,
  })

export default i18n
